class Solution {
  int maximumTripletValue(List<int> nums) {
    int result = 0;
    int n = nums.length;
    List<int> leftMax = List.filled(n, 0);
    leftMax[0] = nums[0];
    for (int i = 1; i < n; i++) {
      leftMax[i] = max(leftMax[i - 1], nums[i]);
    }
    int rightMax = nums[n - 1];
    for (int k = n - 2; k > 0; k--) {
      if (nums[k] < rightMax) {
        for (int i = 0; i < k; i++) {
          if (leftMax[i] > nums[k]) {
            result = max(result, (leftMax[i] - nums[k]) * rightMax);
          }
        }
      }
      rightMax = max(rightMax, nums[k]);
    }
    return result;
  }

  int max(int a, int b) {
    return a > b ? a : b;
  }
}
